import "./Slogin.css"
import {Link} from "react-router-dom"
function Stafflogin() {
    let navigate=useNavigate();

    const [credentials, setCredentials] = useState({ email: "", password: "" });

    const handleSubmit=(e)=>{

        e.preventDefault();

        navigate('/shome');

    }

    const handleChange = (e) => {

        e.preventDefault();

        setCredentials({ ...credentials, [e.target.name]: e.target.value })

      }



      return (

        <div className="main456">



          {/* <Navbar/> */}

          {/* <header>JIIT Placement Portal</header> */}

          {/* <div className="container1 container-fluid">  */}

          <div className="container1"> 

            <h2 className="admin fs-4 text-start">Student Login</h2>

            <form onSubmit={handleSubmit}>

              <div className="form-group mb-3 my-4">

              <label htmlFor="email" className="ftext">Email:</label>

            <div className="inpbox">

              <input

                type="text"

                className="form-control"

                id="email"

                name="email"

                value={credentials.email}

                aria-describedby="emailHelp"

                placeholder="Enter email"

                onChange={handleChange}

              />

            </div>

            </div>

            <div className="form-group ">

            <label htmlFor="password" className="ftext">Password:</label>

            <div className="inpbox">

              <input

                type="password"

                className="form-control"

                id="password"

                name="password"

                value={credentials.password}

                placeholder="Password"

                onChange={handleChange}

              />

            </div>

            </div>

          <button type="submit" className="btn btn-primary my-3 mt-5 signin" >

            Sign in

          </button>

          <div className="text-center">

            <Link to="/stafflogin" className="link text-muted">Sign in as Student?</Link><br /><br />

          </div>

        </form>

      </div>

    </div>

  );

}

export default Stafflogin;
